actionConfiguration.body:
(data) => {
		var editedAccounts = data;
		var bundleArray = [];
		for (let i = 0; i < editedAccounts.length; i++) {
			var newAccount = {
				"label": editedAccounts[i].chain_bundle_id,
				"value": editedAccounts[i].chain_bundle_id,
			};
			bundleArray.push(newAccount);
		}
		return bundleArray
	}

